The Reverse Combat mode, along with the Decks modifier, should become permanent in the game, just like what happened with the Arena Brawl mode.
Below is how I believe this modifier (Decks) should be implemented in the game:

1 - Every season should have an exclusive skin to be earned after opening a minimum number of Packs (just like the current exclusive Pack opening skin is Nita Dustin);

2 - Instead of 96 Brawlers available to unlock their Decks (as it is currently), I believe 30 Brawlers is the ideal number per season, so in the long run it will take several seasons for a player to unlock the Decks of all Brawlers, and the game team can choose which Brawlers they want in each season of the Decks modifier;

3 - Each Deck consists of 25 Cards, with an average of 9 Common (blue background), 10 Epic (purple background), and 6 Legendary (gold background). The idea is that instead of unlocking an entire Deck in Packs, you unlock Cards. This way, the more you play with a Brawler, the more Waffles you earn, buy more Packs, and get more cards to improve that Brawler's Deck in matches;

4 - Complementing idea 3, there may be different types of Packs, where the chances of getting common, epic, and legendary cards are different, which may change the value of these Packs;

5 - A new card rarity may be added: rare cards;

6 - Just like in Pok√©mon where each player chooses one of 3 starter Pok√©mon, there can be 3 starter Brawlers for the player to choose from when starting the Decks modifier for the first time. One of them is obviously Shelly, who is already classified as the default starter Brawler, the other two can be Nita and Barley. These starters can also be changed from time to time, as needed by the game, so players can test different types of Brawlers and less used Brawlers in the game;

7 - Since each mode that uses the Decks modifier (Inverted Combat and Tracking Hawkins) has a total of 5 Phases, and in each Phase the player chooses between 3 Cards, this means that the player's Brawler Deck must contain at least 7 Cards to be used, so there will always be at least 3 Cards to choose from in each Phase. This means that to unlock a Brawler to play with the Decks modifier, the player must find at least 7 cards from that Brawler's Deck;

8 - Complementing items 6 and 7, the Starting Brawler can begin with 7 common cards already enabled when selected as the starting Brawler, OR when choosing the starting Brawler the player chooses 7 Common Cards from that Brawler's Deck to enable, OR when choosing a starting Brawler 7 random cards from that Brawler's Deck are abilities, OR when choosing a starting Brawler the entire Deck of that Brawler is automatically enabled at the moment of this choice. If the last option is implemented in the game, it's interesting because the player will know the feeling and gameplay of using a Brawler with their entire Deck enabled, and this will motivate and encourage the player to unlock the complete Deck of the other possible Brawlers, even if it means acquiring each card individually from packs;

9 - There may be seasonal themed Packs, guaranteeing that upon opening the pack the player will find cards with specific rarities or guaranteeing at least one card from the Brawler Deck of a specific trio, and other possibilities for implementing Packs with specific themes and possibilities;

10 - Cards can be altered, strengthened, weakened, have their rarity changed, be removed or added to the game, as needed to balance the game modes that use the Decks modifier;

11 - New cards can be created to increase the number of possibilities in Brawlers' Decks;

12 - A system for buying, donating, and trading cards from decks between players of the same Club could be implemented, similar to the card donation and trading system in Clash Royale Clans. This would add another function and dynamic for social interaction between players of the same Club, encouraging the use of Clubs and the social factor inherent in them;

13 - A player can favorite specific cards from a Brawler's Deck, whether they are cards they already own or cards they wish to acquire;

14 - The other features of the Reverse Combat and Tracking Hawkins modes can remain, such as the player not being able to switch Brawlers while in a "run," unless they finish all 5 stages with that Brawler or lose the next match of that "Run." And new game modes can be created or old game modes altered so that the Decks modifier works in them.


These are my suggestions on how the Decks modifier, initially focusing on Reverse Combat and Tracking Hawkins modes, can be definitively implemented in the game, aiming for its longevity within the game.

And this Decks modifier encourages players to play multiple times with the same Brawler, which increases the mastery that the player will have with that Brawler, facilitates the completion of Records, and makes the player explore more build possibilities, buying all the accessories, hyper charge, gears, and star power of that Brawler, which ends up fostering the game's economy and replayability for the players.
